import React, { useState } from "react";
import { FaStream } from "react-icons/fa";
import { VscClose } from "react-icons/vsc";

const Header = () => {
    const [close, setClose] = useState(false);

    const MobileViewBtn = () => {
        setClose(!close);
    };
    return (
        <div className="w-40/50 bg-white ml-auto mr-auto mt-3 rounded">
            <header className="flex justify-between cursor-pointer">
                <div className="">
                    <img
                        src="/logo.png"
                        alt="logo"
                        className="w-10 h-10 rounded-full "
                    />
                </div>
                <div
                    className="h-5 w-4 mt-3 md:hidden"
                    onClick={() => MobileViewBtn()}
                >
                    {close ? (
                        <VscClose className="h-5 w-4" />
                    ) : (
                        <FaStream className="h-10 w-4" />
                    )}
                </div>
                <div className="flex">
                    <ul>
                        <li>About</li>
                        <li>Portfolio</li>
                        <li>Work</li>
                        <li>Contact</li>
                    </ul>
                </div>
            </header>
        </div>
    );
};

export default Header;
